import React from 'react'

class BadgesList extends React.Component{
	render(){
		return(
			<ul className="list-unstyled">
				{this.props.badges.map((badge) =>{
					return (
						<li key={badge.id}>
							<p>
								{badge.firstName} {badge.lastName}
							</p>
							<p>
								{badge.twitter} / {badge.email} 
							</p>
							<p>
								{badge.jobTitle} 
							</p>
						</li>
					);
				})}
			</ul>
		);
	}
}

export default BadgesList;
